INSERT INTO `episodios` (`idSerie`, `temporada`, `capitulo`, `sinopsis`, `titulo`, `fechaEstreno`) VALUES
(1, 2, 9, 'Rick, Hershel y Glenn quedan atrapados y luchan por sobrevivir a nuevos enemigos vivos y muertos; Shane encuentra a Lori en peligro a mitad del camino y hace de su misión regresarla a la granja.', 'Con el dedo en el gatillo', '2012-01-21'),
(1, 4, 14, 'Tyresse, Carol, Mika, Lizzie y Judith teniendo como objetivo de llegar al terminus, se detienen en una casa abandonada, donde Lizzie comienza a tener problemas con el grupo llevando unas consecuencias irreparables.', 'La arboleda', '2014-03-16'),
(1, 4, 15, 'Rick, Michonne y Carl siguen en las vías tratando de llegar a Terminus. Daryl comienza a acoplarse en el grupo de Joe, sin tener idea de cual es su objetivo. Frente a la necedad de continuar su camino en las vías, Glenn provoca una separación entre él y Tara del grupo liderado por Abraham. Teniendo la idea de no dejarlos ir, Eugene dirige ingeniosamente a Rosita para que ella vaya a un punto donde pueda encontrarlos, pero a su vez, encuentran al grupo de Maggie, Bob y Sasha, que más tarde se ree', 'Nosotros', '2014-03-23'),
(4, 1, 1, 'El rey Robert Baratheon de Poniente viaja al Norte para ofrecerle a su viejo amigo Ned Stark, Guardián del Norte y Señor de Invernalia, el puesto de Mano del Rey. La esposa de Ned, Catelyn, recibe una carta de su hermana Lysa que implica a miembros de la familia Lannister, la familia de la reina Cersei, en el asesinato de su marido Jon Arryn, la anterior Mano del Rey. Bran, uno de los hijos de Ned y Catelyn, descubre a la reina Cersei y a su hermano Jaime teniendo relaciones sexuales. Mientras t', 'Se acerca el invierno', '2011-04-17'),
(4, 3, 4, 'Jaime Lannister roba una espada e intenta escapar de sus captores. Varys conversa con Olenna Tyrell sobre el peligro que constituye Petyr Baelish para todos. Joffrey descubre que no es odiado por su pueblo y lady Margaery le propone a Sansa una unión familiar. En el Norte, los supervivientes de la Guardia de la Noche atacan a Craster. Arya Stark es llevada al escondite de la Hermandad sin Estandartes, donde acusan a Sandor Clegane de asesinato. Daenerys entrega uno de sus dragones a cambio del e', 'Y ahora su guardia ha terminado', '2013-04-21'),
(3, 6, 24, 'Howard se encuentra dentro del cohete, con sus compañeros astronautas Dimitri Rezinov y Mike Massimino en la cápsula Soyuz. Momentos antes del despegue, Howard empieza a recordar los dos últimos días.\r\nEn casa de Wolowitz, Bernadette decide que quiere casarse con Howard antes de que suba al espacio. Éste la recuerda que se va a la luna en dos días. Deciden casarse rápidamente con sus amigos, y celebrar el banquete posteriormente.', 'La reflexión de la cuenta atrás', '2012-05-10'),
(1, 3, 9, 'Rick trata de rescatar a uno de los miembros de su grupo (Daryl). Woodbury está en desorden tras el ataque reciente. Los nuevos huéspedes de la prisión causan preocupación.', 'El rey suicida', '2013-02-12'),
(6, 19, 13, 'El título y el argumento del episodio es una referencia a la película Infiltrados,1 2 de Martin Scorsese, Todo comienza cuando Marge lleva a Bart y a Lisa a la escuela en el auto de Homer, y los niños comienzan a pelear. Cuando Marge trata de detener la pelea, accidentalmente choca con el auto de Hans Moleman.', 'Infilbartado', '2008-01-10');

