INSERT INTO `series` (`idSerie`, `nombre`, `titular`, `sinopsis`, `estreno`, `finalizacion`) VALUES
(1, 'The Walking Dead', 'Zombies a punta pala.', 'Todos corren, se mueren y renacen como zombies.\n\nAh! Y hay un chico con sombrero y pistola.', '2011-02-09', NULL),
(2, 'One Piece', 'Un tio de chicle', 'Una historia épica de piratas, donde narra la historia de "Monkey D. Luffy" quien cuando tenia 7 años, comió accidentalmente una "Akuma no mi" (Fruta del diablo) llamada Gomu Gomu no mi, la cual le convirtió en un hombre de goma. Por otra parte "Gold Roger" conocido como "El rey de los Piratas" quien fuera ejecutado por la Marina, habló antes de morir, acerca de su mayor tesoro, escondido en el "Grand line". Esta noticia desató la gran era de los piratas lanzando a incontables piratas a "ese lug', '1999-01-19', '2043-11-03'),
(3, 'The Big Bang Theory', 'un friki hilarante que cree que lo sabe todo', 'Leonard Hofstadter y Sheldon Cooper son dos físicos brillantes que trabajan en Cal Tech en Pasadena, California. Son colegas, mejores amigos y compañeros de piso. También están el ingeniero mecánico Howard Wolowitz y el astrofísico Rajesh Koothrappali, colegas y amigos de Cal Tech. El cuarteto gasta la mayor parte del tiempo trabajando en sus proyectos individuales, jugando videojuegos, viendo series y películas de ciencia ficción o leyendo comics.', '2007-02-05', NULL),
(4, 'Juego De Tronos', 'Si te gusta un personaje, lo matan fijo', 'La historia de Canción de Hielo y Fuego se sitúa en un mundo ficticio medieval, principalmente en un continente llamado Poniente pero también en un vasto continente oriental, conocido como Esos. La mayor parte de los personajes son humanos pero a medida que la serie avanza aparecen otras razas, tales como los fríos y amenazadores Otros del Norte y los dragones del Este, ambos supuestamente extintos al principio de la saga. Hay tres líneas argumentales en la serie: la crónica de la guerra civil ', '2011-05-12', NULL),
(5, 'How I Met Your Mother', 'Cinco tios bebiendo siempre en un bar', 'En el año 2030, Ted (Josh Radnor) relata a sus dos hijos adolescentes cómo conoció a su madre y cómo fue su vida hasta que, por fin, encontró el amor verdadero. Todo empezó cuando Marshall (Jason Segel), su mejor amigo, decidió casarse con Lily (Alyson Hannigan), su novia de toda la vida. Entonces Ted decidió lanzarse a la búsqueda del amor verdadero y formar una familia.', '2005-11-11', '2014-03-10'),
(6, 'Los Simpson', 'Un tonto de amarillo y su familia', 'Narra las historias de una peculiar familia (Homer, Marge, Bart, Maggie y Lisa Simpson) y otros divertidos personajes de la singular localidad norteamericana de Springfield. ', '1989-12-28', NULL),
(7, 'American Horror Story', 'Una serie que da mucho miedo, y cada vez va a mejor', 'Drama psicológico, sufrimiento, sucesos sobrenaturales, intriga. Sigue el formato de serie de antología: cada temporada se ha concebido como una miniserie independiente, con  personajes y escenarios distintos, y una trama que tiene su propio comienzo, parte central y final. Por tanto, no existe continuidad entre ellas y pueden verse de forma independiente.', '2011-02-04', NULL),
(8, 'Dragon Ball Z', 'Tíos muy fuertes que están todo el dia volando y dándose palos.', 'La historia de Dragon Ball Z se divide en cuatro ramas centrales, repartidas en un total de 291 episodios. La primera abarca desde que Son Gohan, hijo de Goku, es raptado por el saiyan Raditz. La etapa de Freezer lleva a Goku, Krillin, Vegeta y Bulma al planeta Namek. La Saga de los Androides, que da comienzo cuando tres androides (C-16, C-17, C-18) comienzan a aterrorizar la tierra, hasta la llegada de Célula. La última etapa de Z la cubre la Saga de Buu. Comienza cuando Babidí, un brujo bastan', '1989-04-26', '1996-01-31'),
(9, 'House', 'Un médico que está como una regadera y encima cojo. Pero es muy bueno en su trabajo.', 'House (o House M.D., donde M.D. es acrónimo de “Medicine Doctor”) la serie donde Hugh Laurie encarna el papel de un complejo médico especialista en enfermedades infecciosas, el cual se niega a visitar a sus enfermos porque, como siempre repite, “everybody lies” ("todos mienten"). Por ello, intenta buscar soluciones mediante métodos poco ortodoxos. House es un tipo solitario y escéptico, con una lengua afilada y modaz, amante de la música (toca el piano y la guitarra) y con una personalidad llena', '2004-11-16', '2012-05-21'),
(10, 'Modern Family', 'Una familia muy divertida a la que le ocurren cosas embarazosas.', 'Aclamada serie -es sin duda la sitcom más premiada en los últimos años- que narra el día a día de Jay Pritchett (Ed O’Neill) y su familia, compuesta por su mujer (mucho más joven) Gloria Delgado (Sofia Vergara) y su hijo Manny, y al mismo tiempo muestra la vida de otras dos familias compuestas por su hijo gay Mitchell (Jesse Tyler Ferguson), casado con Eric (Cameron Tucker) y padre adoptivo de una niña, y su hija Claire (Julie Bowen), madre de 3 hijos pequeños.', '2009-03-12', NULL);

